class Data {  Data({      this.name,       this.id,       this.title,       this.description,       this.status,       this.detailsAddress,       this.phone,       this.country,       this.image,       this.userId,       this.categoryId,       this.startDate,       this.endDate,       this.startTime,       this.endTime,});  Data.fromJson(dynamic json) {    name = json['name'];    id = json['id'];    title = json['title'];    description = json['description'];    status = json['status'];    detailsAddress = json['details_address'];    phone = json['phone'];    country = json['country'];    image = json['image'];    userId = json['user_id'];    categoryId = json['category_id'];    startDate = json['start_date'];    endDate = json['end_date'];    startTime = json['start_time'];    endTime = json['end_time'];  }  String ?name;  int ?id;  String ?title;  String ?description;  String ?status;  String? detailsAddress;  String? phone;  String? country;  String? image;  int? userId;  int? categoryId;  String ?startDate;  String ?endDate;  String? startTime;  String ?endTime;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['name'] = name;    map['id'] = id;    map['title'] = title;    map['description'] = description;    map['status'] = status;    map['details_address'] = detailsAddress;    map['phone'] = phone;    map['country'] = country;    map['image'] = image;    map['user_id'] = userId;    map['category_id'] = categoryId;    map['start_date'] = startDate;    map['end_date'] = endDate;    map['start_time'] = startTime;    map['end_time'] = endTime;    return map;  }}